"use strict";

import "./index"
import Normalize from 'react-normalize'
import Header from "./scripts/modules/components/header";
import Navbar from "./scripts/modules/components/navbar";
import Main from "./scripts/modules/pages/page_main/main";

function App() {
    return (
        <div className="App bg-black font-manrope">
            <Normalize/>
            <div className="bg-space bg-cover bg-no-repeat">
            <Header>
                <Navbar/>
                <Main/>
            </Header>
        </div>
        </div>
    )
}

export default App;
